import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import Home from './pages/Home';
import About from './pages/About';
import Contact from './pages/Contact';
import Header from './pages/Header';
import NotFound from './pages/NotFound';

function App() {
  return (
    <Router>
      <div className="container">
        <br />
        <br />
        <br />
        <br />
        <br />
        <Header></Header>
        <Switch>
          <Route exact path="/" component={Home}></Route>
          <Route exact path="/about-our-center" component={About}></Route>
          <Route exact path="/contact-us" component={Contact}></Route>
          <Route component={NotFound}></Route>
        </Switch>
        <img src={logo} className="App-logo" alt="logo" />
        <div className="logo">
          <h1 className="logotitle">Center for Better Learning</h1>
          <h2 className="logotagline">
            Better Vision. <span className="logoyellow">Brighter</span> Future.
          </h2>
        </div>
      </div>
    </Router>
  );
}

export default App;
